  [],\n\t\"revision_timestamp\": \"2016-10-15T16:36:52.478291\",\n\t\"name\": \"great-bay-national-wildlife-refuge-annual-narrative-report-calendar-year-1995\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Great
  Bay Wildlife Management Area outlines Refuge accomplishments during the 1995 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is also covered. The report includes a planning section which discusses
  the management plan, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, other manpower programs, volunteer
  programs, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, grasslands, other habitats, and pest
  control. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh and water birds, shorebirds, raptors, other
  migratory birds, game mammals, other resident wildlife, fisheries resources, animal
  control, and marking and banding. The public uses of the Refuge described in this
  report include interpretive programs, hunting, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, communications systems, and computer systems. Cooperative programs
  are discussed as well.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
